class Solution {
    public int maxOperations(String s) {
        int count = 0;
        int countNumOne = 0;
        int per = -1;
        for (int i = 0; i < s.length(); i++) {
            if(s.charAt(i) == '1'){
                countNumOne++;
                per = 1;
            }else {
                if(per == 1) count+=countNumOne;
                per = 0;
            }
        }
        return count;
    }
}
